import React from 'react';
import './MatchCard.css';

function MatchCard({ name, team }) {
  return (
    <>
        {console.log(team)}
      {name.length > 1 ? (
        <div>
          <div className="card">
            <div className="container">
              <h4><b>Name/s: {name.name1} & {name.name2}</b></h4>
              <p>Team name: {team.name}</p> 
            </div>
          </div>
        </div>
      ) : (
        <div>
          <div className="card">
            <div className="container">
              <h4><b>Name/s: {name}</b></h4>
              <p>Team name: {team.name}</p> 
            </div>
          </div>
        </div>
      )}
    </>
  );
}

export default MatchCard;
